Information
------------------------------

Life on the Reef 
Over the course of a year, Life on the Reef follows those who live in one of the most extraordinary places on the planet. From the fringing reefs, the coral cays and the islands of the Torres Strait, the human residents of the Great Barrier Reef find the critical balance between our needs and those of an ever-diminishing natural world. Life on the Reef combines the very best of observational documentary story telling with cutting edge blue chip natural history to present a unique and fresh angle on Australia's greatest natural icon. This is the blue frontier... where man meets wild and nature calls the shots.


1)  Winter 
Tourists flock to the reef as humpback whales arrive to give birth; fire destroys a luxury yacht and a critical salvage mission is launched; and 20,000 green sea turtles arrive to nest at the biggest turtle rookery on Earth.

2)  Spring 
Spring brings an explosion of life to the reef as corals spawn, sea birds nest, and turtle hatchlings erupt over the beaches in tens of thousands. Manta rays swoop in to feed on the nutrient rich seas.

3)  Summer 
It's summer, the change of season. Animal and human residents prepare as a Category 5 cyclone threatens the coast. How will the reef respond to threats that challenge its delicate balance?

